import React from "react";
import './Circle.css';
import Circle0 from "./Circle0";

function Circle(props){
    switch(props.rate){
        case "0" :
            return <Circle0 />
        case "1" :
            return <div className="yellowCircle"></div>
        case "2" :
            return  
        case "3" :
            return
        case "4" :
            return
        case "5" :
            return
    }
    return (
        <>
        {props.rate}
        <div className="yellowCircle"></div>
        <div className="greyCircle"></div>
        <div className="greyCircle"></div>
        <div className="greyCircle"></div>
        <div className="greyCircle"></div>
        </>
    )
}

export default Circle;
